import logo from './logo.svg';
import './App.css';
import ProductForm from './components/ProductForm/ProductForm';
import ProductList from './components/ProductList/ProductList';
import { useState } from 'react';

const dummy_init = [
  {
    id: '1',
    name: 'falana',
    category: 'ele',
    price: 2000,
  },
  {
    id: '1',
    name: 'falana',
    category: 'ele',
    price: 2000,
  }
]

const App = (props) =>  {
  const [dummy, setDummy] = useState(dummy_init);
  return (
    <div className="App">
      <ProductForm />
      <ProductList items={dummy}>{props.children}</ProductList>
    </div>
  );
}

export default App;
